  }

  return(
    <div id='sideNavi-container'>
      <h3 id='title'>Markdown</h3>
      <p id='myDoc'>my documents</p>
      <NewDocButton />
      <DarkmodeBtn 
        // label="sun"
        toggled={true}
        onClick={logState} 
      />
    </div>
  )
}

export default SideMenu;
